import './App.css';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import { Navbar } from 'react-bootstrap';
import Home from './Pages/Home'

function App() {
  return (

    <>
   <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
      <Footer /> {/* Place footer outside of Routes if you want it on all pages */}
    </Router>
    </>
  );
}

export default App;
